import { styled } from "styled-components";

import style from "../style/style"

const NavContainer = styled.nav`
  position: absolute;
  left: ${style.layout.wideMargin/3-style.layout.narrowMargin.width};
`
const UlBox = styled.ul`
  list-style: none;
  &>li{
    border: solid orange 1px;
  }
`


function Nav(){
  return(
    <NavContainer>
      <UlBox>
        <li>1번 메뉴</li>
        <li>2번 메뉴</li>
        <li>3번 메뉴</li>
        <li>4번 메뉴</li>
        <li>5번 메뉴</li>
      </UlBox>
    </NavContainer>
  )
}
export default Nav;
